It's always a good time for a PYT ! Find out why people all over the world are addicted to this all-in-one styling tool ! Create  perfect spirals , like waves on the beach, but also create  perfect smooth in seconds. Made of 100% ceramic in natural color , wrapped in the highest materials in the market that makes the product delicate to the touch, this product moisturises the hair with infrared heat and reduces frizz through the action of negative ion s. It smooths the hair and softens the hair . 

TECHNOLOGIES & PROPERTIES: 


INFRARED:  far-infrared heat preserves moisture in the hair shaft and protects the cuticle; 

NEGATIVE IONS:  negative ions eliminate frizz, soften the hair and smooth them for maximum shine 

TORMALINE COATING:  it is a very particular material that allows to distribute the heat evenly and also emit negative ions naturally as soon as it comes into contact with heat. 

TEMPERATURE: 

It reaches 230  C in a few seconds thanks to the Turbo Boost; 
temperature lock to prevent accidental changes; 
greater sliding capacity; 
Possibility to adjust the temperature. 


PHYSICAL CHARACTERISTICS OF THE PRODUCT: 

100% ceramic (also internal heating elements) and tourmaline coating; 
Width 3.18 cm; 
Externalcoating 
2.6 meter long power cable swivel, useful for preventing cable nodes; 
double voltage 110-240V, 105 / 60W Universal voltage makes it your perfect travel companion; 
Hook to hang in rubber on the base of the handle 

COLOR:Peacok 
Warranty for 2 years with the possibility of extending the warranty for 5 years with extra cost. 

Linnovativa piastrain ceramica   scivola meglio tra i capelli , per un meraviglioso effetto liscio e lucido . Il cuore della piastra  la tecnologia infrarossi , che permette alla piastradi raggiungere in un attimo e in maniera uniforme la temperatura desiderata (fino a 230C), per uno styling professionale e rapido allo stesso tempo. Grazie alla tecnologia ioni negativi elimina leffetto crespo in modo duraturo, donando brillantezza ai vostri capelli; la tormalina che ricopre le lame che sono 100%ceramica contribuisce poi ad assicurare una maggiore luminosit e protezione della vostra chioma. 

T he innovative ceramic plate slips better in the hair , for a wonderful  smooth and shiny effect . The heart of the plate is the  infrared technology , which allows the plate to reach in a moment and in a uniform manner the desired temperature (up to 230  C), for a  professional and fast styling  at the same time. Thanks to the  negative ions technology , it  eliminates the frizzy effect  in a lasting way, giving  shine to your hair ; the tourmaline that covers the blades that are  100% ceramic  then contributes to ensuring greater brightness and protection of your hair.

